import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the search input by its placeholder text and fill it
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('iPhone');

    // Take a screenshot after filling the input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_input_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_input_filled.png'));

    // Locate the first search button and click it
    const searchButton = page.locator('.search-btn').first();
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // Take a final screenshot after the search action
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_submitted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_submitted.png'));

    // Extract the value from the search input to verify the action
    const enteredText = await searchInput.inputValue();

    return {
      success: true,
      action: "Searched for 'iPhone' products",
      extractedData: {
        searchText: enteredText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
